import React from "react";
import '../assets/css/TagBtn.css';

class TagBtn extends React.Component {
  state={
    isActive:false,
  }

  render() {

    return (
      <div className={"TagBtnBox"+" "+this.state.isActive?"TagBtnActive":"TagBtnNormal"}>
         {this.props.title}
      </div>
    );
  }
}

export default TagBtn;
